The data was sourced from Dept of Agriculture Forestry and Fisheries. For more information please see http://data.daff.gov.au/data/warehouse/9aam/fsrXXd9abm_/fsr15d9abm_20151030/01_FishStatus2015Overview_1.1.0.pdf

Data used to produce MAR37 in SoE2016. See;
https://soe.environment.gov.au/theme/marine-environment/topic/2016/sustainability-and-sector-management#marine-environment-figure-37

This dataset includes Solid waste levy rates (Metropolitan and Country) and Liquid waste levy rates from July 1994 to July 2024. This data should only be used as a guide, this is not a legal document.
More information about waste levy rates is available on the EPA website;
https://www.epa.sa.gov.au/business_and_industry/waste-levy
